import React from 'react'
import styled from 'styled-components'

const Section = styled.section`
	min-height: 100vh;
	height: auto;
	width: 100vw;
	margin: 0 auto;
	overflow: hidden;
	display: flex;
	justify-content: flex-start;
	align-items: flex-start;
`
const Shop = () => {
  return <Section>Shop</Section>
}

export default Shop
